  \"2015-01-22T15:57:32.598823\",\n\t\"name\": \"cpd-appropriations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The datasets are the full-year allocations
  for HUD's Office of Community Planning and Development (CPD) formula programs: Community
  Development Block Grants (CDBG); HOME Investment Partnerships (HOME), including
  the American Dream Downpayment Initiative (ADDI); Housing Opportunities for Persons
  with AIDS (HOPWA); and Emergency Shelter Grants (ESG). HUD's CPD office seeks to
  develop viable communities by promoting integrated approaches that provide decent
  housing, a suitable living environment, and expand economic opportunities for low
  and moderate income persons. The primary means towards this end is the development
  of partnerships among all levels of government and the private sector, including
  for-profit and non-profit organizations. There are datasets that provide the allocation
  amounts from 2001 to 2011.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
